import './Card.css';
import { NavLink } from 'react-router-dom'

export default function Card({ id, name, image, temperaments, weight }) {
    return (
        <div className="upperDiv">
            <div className="imgName">
                <img src={image} alt="This is a Dog" className="image" />
                <NavLink to={`/dogs/${id}`}><h2 className="nameGame">{name}</h2></NavLink>
                <div className="divTemps">Temperaments: {temperaments}</div>
                <div className="divWeight">Weight: {weight}</div>
            </div>
        </div>
    )
}
